// HomeSection.js
import React from 'react';
import RectangleDrawer from './RectangleDrawer';

const HomeSection = () => {
  const imageUrl = "public/scandinavian-interior-mockup-wall-decal-background 1.png"; // Replace with your image path or URL
  const rectangles = [
    { x: 50, y: 50, width: 100, height: 80, color: 'blue', lineWidth: 3 },
    // Add more rectangles as needed
  ];

  return (
    <div style={{ width: '100%', height: '100%', backgroundColor: '#f0f0f0', textAlign: 'center', paddingTop: '20px', position: 'relative' }}>
      <h2>Your Home Section</h2>
      <RectangleDrawer imageUrl={imageUrl} rectangles={rectangles} />
    </div>
  );
};

export default HomeSection;
